import './App.css';
import TypeWriter from 'typewriter-effect'


function Heading() {
  return (
  <div className='tracking-wider	font-mono text-white text-9xl text-center'> 
      <TypeWriter 
        onInit={(typewriter) => { loop(),
          typewriter.typeString("Hello, I'm Faizan Mian").pauseFor(1000).start().deleteAll(5)
        }}
      />
  </div>
  );
}

export default Heading;
